Vizcaya: Palace of Dreams

Arts Documentary hosted by Andy Garcia, published by PBS in 2009 - English narration


Information
------------------------------

During the early 20th century, captains of industry and commerce built lavish palaces to showcase their newly acquired wealth. Narrated by actor Andy Garcia, VIZCAYA details the incredible vision of International Harvester Vice President James Deering (1859-1925) in constructing his &quot;Palace of Dreams&quot; on Miami's bayside frontier. The high-definition documentary details the confluence of talent responsible for building the 180-acre estate, which required employing one-tenth of Miami's population and took almost a decade to complete. Today, this National Historic Landmark stands as a quintessential example of American Renaissance architecture, landscape design, decorative arts and art collecting.

